import { Badge, Card, Table } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";

function TokenModal(props) {
  const [alltokens, setAllTokens] = React.useState(props.tokenDetails);
  return (
    <Modal
      {...props}
      className="text-white"
      size="md"
      aria-labelledby="contained-modal-title-vcenter"
      centered>
      <Modal.Header
        style={{
          background: "rgba(5, 24, 57, 255)",
        }}
        closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          Select Tokens
        </Modal.Title>
      </Modal.Header>
      <Modal.Body
        style={{
          background: "rgba(5, 24, 57, 255)",
        }}>
        <Card.Header className="bg-transparent border-0">
          <input
            type="text"
            placeholder="Search Tokens"
            style={{
              marginLeft: "2px",
              borderRadius: "20px",
              height: "40px",
              width: "300px",
              color: "white",
              background: "rgba(5, 24, 57, 255)",
              border: "1px solid rgba(255, 255, 255, 0.2)",
            }}
          />
        </Card.Header>
        <Card.Body>
          <Table>
            <tbody>
              {props.tokenDetails.map((token) => {
                return (
                  <tr>
                    <td className="text-white">
                      <div className="d-flex align-items-center">
                        <img
                          src={token.icon}
                          width="30"
                          height="30"
                          className="d-inline-block align-top"
                          alt="Mudex logo"
                        />
                        <div className="ms-3">
                          <h6 className="mb-0 text-white">{token.name}</h6>
                        </div>
                      </div>
                    </td>
                    <td>
                      <Badge bg="" className="badge-primary light">
                        0
                      </Badge>
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </Table>
        </Card.Body>
      </Modal.Body>
    </Modal>
  );
}

export default TokenModal;
